package com.company;import java.util.Scanner;public class MaxSequenceofEqualElements_07 {    public static void main(String[] args) {        Scanner scanner = new Scanner(System.in);        String[] input = scanner.nextLine().split(" ");        int[] numbers = new int[input.length];        for (int i = 0; i < numbers.length; i++) {            numbers[i] = Integer.parseInt(input[i]);        }        int coutner = 0;        int temporary = 0;        int lenght = 0;        for (int i = 0; i < numbers.length - 1; i++) {            int firstNumber = numbers[i];            int secondNumber = numbers[i + 1];            if (firstNumber == secondNumber) {                coutner++;                if (lenght < coutner) {                    lenght = coutner;                    temporary = numbers[i];                }            } else {                coutner = 0;            }        }        for (int i = 0; i <= lenght; i++) {            System.out.print(temporary + " ");        }    }}